import { Fragment } from 'react'
import { useHistory } from 'react-router-dom'

const Game = () => {
  return (
    <Fragment>
      <h1>Game Juniper Green</h1>
      <button onClick={() => history.goBack()}>Back to the home page</button>
      <button onClick={() => history.push("/rules")}>Rules</button>
      <button onClick={() => history.goBack()}>Reset</button>
    </Fragment>
  );
}

export default Game;
